import "./Navbarstyles.css"

import React from 'react'
import { Link } from "react-router-dom"

const Navbar = () => {
  return (
    <div className="header">
        <Link to={"/"}></Link>
        <h1>Portfolio</h1>
    </div>
  );
};

export default Navbar;
